import React from "react";

export default class Stateeg extends React.Component{

    constructor(){
        super()
        this.state={

            data:'JavaScript',
            version:18,
            sub:['evs','math','history'],
            obj:{
                uname:"pooja",
                pass:"pooja123"
            },
            products:[
                {pid:101,pname:"pooja"},
                {pid:102,pname:"shaurya"}
            ]


        }};

        render(){
            return(
                <div>
                    <p style={{color:'brown'}}>{this.state.data}</p>
                    <p style={{color:'blue'}}>{this.state.version}</p>
                    <p style={{color:'violet'}}>{this.state.sub}</p>
                    <p style={{color:'yellow'}}>{JSON.stringify(this.state.obj)}</p>
                    <p style={{color:'red'}}>{JSON.stringify(this.state.products)}</p>
                </div>
            )
        
    }
}
